import React, { Component } from 'react';
import { Link } from 'react-router-dom';


class Home extends Component {

  getUser(userId) {
    console.log(userId)
  }

  render() {
    return (
    <div className="App">
      <div>
          <div >
            <h1>This is Anfield</h1>
                <p> <i>Home of liverpool -The greatest club Known to man- </i> </p>
                <link to ={'./list'}> <button variant= "raised"> Go to the teamsheet</button> </link>
          </div>
      </div>




      <h1>Project Home</h1>
      {/* Link to List.js */}
      <Link to={'./list'}>
        <button variant="raised">
            My List
        </button>

      </Link>
      <div>
          {
            [1, 2, 3, 4, 5].map(value => {
              return (
                <div key={value}>
                  <button onClick={() => this.getUser(value)}>{value}</button>
                </div>
              )
            })
          }
        </div>
    </div>
    );
  }
}
export default Home;
